<script>
export default {
  data(){
    return{
        delay:0.1,
        duration:1,
        strokeWidth:2,
        timingFunction:'linear',
        strokeColor:'red',
        repeat:false,
    }
  },
  methods:{
    setTextAnimation:(delay, duration, strokeWidth, timingFunction, strokeColor,repeat) =>{
            let paths = document.querySelectorAll("path");
            let mode=repeat?'infinite':'forwards'
            for (let i = 0; i < paths.length; i++) {
                const path = paths[i];
                console.log("PATH[i]---->",path);
                const length = path.getTotalLength();
                console.log("LENGTH----->",length);
                path.style["stroke-dashoffset"] = `${length}px`;
                path.style["stroke-dasharray"] = `${length}px`;
                path.style["stroke-width"] = `${strokeWidth}px`;
                path.style["stroke"] = `${strokeColor}`;
                path.style["animation"] = `${duration}s svg-text-anim ${mode} ${timingFunction}`;
                path.style["animation-delay"] = `${i * delay}s`;
            }
        }

//  setTextAnimation(0.1(delay),1(duration),2(strokeWidth),'linear'(timingFunction),'#fff7f8'(strokeColor),false(repeat));

//  setTextAnimation(0.1,2,2,'linear','#fff7f8',false);
   }

 }


</script>

